import React ,{useEffect}from 'react'

const App = () => {
  useEffect(()=>{
    fetch('https://jsonplaceholder.typicode.com/tods').then(
      response => response.json
    ).then(json=>console.log(json))
  },[])
  return (
    <div>
      <h2>hello world</h2>
    </div>
  )
}

export default App
